-- DELIMITER ;
drop table CATEGORIES;
drop table CLIENTS;
drop table COMMANDES;
drop table DETAILS_COMMANDE ;
drop table PRODUITS ;


CREATE TABLE CATEGORIES (
    NOM_CATEGORIE VARCHAR(100),
    DESCRIPTION TEXT,
    CODE_CATEGORIE VARCHAR(20)
) ENGINE=InnoDB
ROW_FORMAT=COMPRESSED
KEY_BLOCK_SIZE=8
DEFAULT CHARSET=utf8mb4
COLLATE=utf8mb4_unicode_ci;


CREATE TABLE CLIENTS (
    CODE_CLIENT VARCHAR(5),
    SOCIÉTÉ VARCHAR(40),
    CONTACT VARCHAR(40),
    FONCTION VARCHAR(40),
    ADRESSE VARCHAR(60),
    VILLE VARCHAR(40),
    REGION VARCHAR(40),
    CODE_POSTALE VARCHAR(40),
    PAYS VARCHAR(20),
    TELEPHONE VARCHAR(20),
    FAX VARCHAR(20)
) ENGINE=InnoDB
ROW_FORMAT=COMPRESSED
KEY_BLOCK_SIZE=8
DEFAULT CHARSET=utf8mb4
COLLATE=utf8mb4_unicode_ci;



CREATE TABLE COMMANDES (
    NUM_COMMANDE VARCHAR(6),
    CODE_CLIENT VARCHAR(5),
    DATE_COMMANDE DATE,
    DATE_LIVRAISON DATE,
    DATE_ENVOI DATE,
    PORT DECIMAL(10,2),
    DESTINATION VARCHAR(40),
    ADRESSE_LIVRAISON VARCHAR(60),
    VILLE_LIVRAISON VARCHAR(15),
    REGION_LIVRAISON VARCHAR(15),
    CODE_POSTALE_LIVRAISON VARCHAR(10),
    PAYS_LIVRAISON VARCHAR(15)
) ENGINE=InnoDB
ROW_FORMAT=COMPRESSED
KEY_BLOCK_SIZE=8
DEFAULT CHARSET=utf8mb4
COLLATE=utf8mb4_unicode_ci;


CREATE TABLE DETAILS_COMMANDE (
    NUM_COMMANDE VARCHAR(20),
    REF_PRODUIT VARCHAR(20),
    QUANTITE INT DEFAULT 1,
    REMISE FLOAT DEFAULT 0
) ENGINE=InnoDB
ROW_FORMAT=COMPRESSED
KEY_BLOCK_SIZE=8
DEFAULT CHARSET=utf8mb4
COLLATE=utf8mb4_unicode_ci;

CREATE TABLE PRODUITS (
    REF_PRODUIT VARCHAR(4),
    NOM_PRODUIT VARCHAR(40),
    CODE_CATEGORIE VARCHAR(3),
    QUANTITE_UNITE VARCHAR(30),
    PRIX_UNITAIRE DECIMAL(19, 0) DEFAULT 0,
    UNITE_STOCK INT DEFAULT 0,
    UNITES_COMMANDEES INT DEFAULT 0,
    NIVEAU_REAPRO INT DEFAULT 0,
    INDISPONIBLE INT DEFAULT 0
) ENGINE=InnoDB
ROW_FORMAT=COMPRESSED
KEY_BLOCK_SIZE=8
DEFAULT CHARSET=utf8mb4
COLLATE=utf8mb4_unicode_ci;

truncate table CATEGORIES;
truncate table CLIENTS;
truncate table COMMANDES;
truncate table DETAILS_COMMANDE ;
truncate table PRODUITS ;






CREATE UNIQUE INDEX CATEGORIES_PK ON CATEGORIES (CODE_CATEGORIE) ;

CREATE UNIQUE INDEX CLIENT_PK ON CLIENTS (CODE_CLIENT);

CREATE INDEX CODE_POSTALE ON CLIENTS (CODE_POSTALE);

CREATE INDEX COMMANDES_INDEX1 ON COMMANDES (CODE_POSTALE_LIVRAISON);

CREATE INDEX COMMANDES_INDEX2 ON COMMANDES (DATE_COMMANDE);

CREATE INDEX COMMANDES_INDEX3 ON COMMANDES (DATE_ENVOI);

CREATE UNIQUE INDEX COMMANDES_PK ON COMMANDES (NUM_COMMANDE);

CREATE INDEX DETAILS_COMMANDE_INDEX1 ON DETAILS_COMMANDE (NUM_COMMANDE);

CREATE INDEX DETAILS_COMMANDE_INDEX2 ON DETAILS_COMMANDE (REF_PRODUIT);

CREATE UNIQUE INDEX DETAILS_COMMANDE_PK ON DETAILS_COMMANDE (NUM_COMMANDE, REF_PRODUIT);

CREATE INDEX PRODUITS_INDEX1 ON PRODUITS (CODE_CATEGORIE);

CREATE INDEX PRODUITS_INDEX2 ON PRODUITS (NOM_PRODUIT);

CREATE UNIQUE INDEX PRODUITS_PK ON PRODUITS (REF_PRODUIT);

CREATE INDEX SOCIETE ON CLIENTS (SOCIÉTÉ);

CREATE UNIQUE INDEX UNIQUE_CONSTRAINT ON CATEGORIES (NOM_CATEGORIE);

ALTER TABLE CATEGORIES ADD CONSTRAINT UNIQUE_CATEGORY_NAME UNIQUE (NOM_CATEGORIE);
ALTER TABLE CATEGORIES ADD PRIMARY KEY (CODE_CATEGORIE);

ALTER TABLE CATEGORIES MODIFY NOM_CATEGORIE VARCHAR(100) NOT NULL;
ALTER TABLE CATEGORIES MODIFY CODE_CATEGORIE VARCHAR(20) NOT NULL;

ALTER TABLE CLIENTS ADD PRIMARY KEY (CODE_CLIENT);
ALTER TABLE CLIENTS MODIFY CODE_CLIENT VARCHAR(5) NOT NULL;

ALTER TABLE COMMANDES ADD PRIMARY KEY (NUM_COMMANDE);
ALTER TABLE COMMANDES MODIFY CODE_CLIENT VARCHAR(5) NOT NULL;
ALTER TABLE COMMANDES MODIFY NUM_COMMANDE VARCHAR(100) NOT NULL;

ALTER TABLE DETAILS_COMMANDE MODIFY QUANTITE INT NOT NULL;
ALTER TABLE DETAILS_COMMANDE ADD PRIMARY KEY (NUM_COMMANDE, REF_PRODUIT);
ALTER TABLE DETAILS_COMMANDE MODIFY REF_PRODUIT VARCHAR(100) NOT NULL;
ALTER TABLE DETAILS_COMMANDE MODIFY NUM_COMMANDE VARCHAR(100) NOT NULL;

ALTER TABLE PRODUITS ADD CONSTRAINT PRODUITS_CHK1 CHECK (indisponible IN (1,0));
ALTER TABLE PRODUITS ADD PRIMARY KEY (REF_PRODUIT);
ALTER TABLE PRODUITS MODIFY NOM_PRODUIT VARCHAR(100) NOT NULL;
ALTER TABLE PRODUITS MODIFY REF_PRODUIT VARCHAR(100) NOT NULL;

ALTER TABLE COMMANDES ADD CONSTRAINT COMMANDES_FK1 FOREIGN KEY (CODE_CLIENT) REFERENCES CLIENTS (CODE_CLIENT);
ALTER TABLE PRODUITS ADD CONSTRAINT PRODUITS_FK1 FOREIGN KEY (CODE_CATEGORIE) REFERENCES CATEGORIES (CODE_CATEGORIE);

ALTER TABLE DETAILS_COMMANDE ADD CONSTRAINT DETAILS_COMMANDE_FK1 FOREIGN KEY (REF_PRODUIT) REFERENCES PRODUITS (REF_PRODUIT);
ALTER TABLE DETAILS_COMMANDE ADD CONSTRAINT DETAILS_COMMANDE_FK2 FOREIGN KEY (NUM_COMMANDE) REFERENCES COMMANDES (NUM_COMMANDE);
